import { useState } from 'react';

export function PartOne() {
  const [show, setShow] = useState(true);
  return (
    <>
      {show ? <div>partOne</div> : null}
      <button
        onClick={() => {
          setShow(!show);
        }}>
        show partOne
      </button>
    </>
  );
}

export function PartTwo() {
  const [show, setShow] = useState(true);
  return (
    <>
      {show ? <div>parttwo</div> : null}
      <button
        onClick={() => {
          setShow(!show);
        }}>
        show parttwo
      </button>
    </>
  );
}
